// server/utils/receiptHtmlTemplate.ts
import { CBEReceiptData } from "~/types";

// Helper function to generate HTML for InfoItem-like structure
function generateInfoItemHtml(
  label: string,
  value: string | undefined | null,
  itemClass: string = "",
  _fullWidth: boolean = false
): string {
  const displayValue = value ?? "-";
  return `
      <div class="flex justify-between items-center text-xs py-0 text-black ${itemClass}">
        <span>${label}</span>
        <span class=" text-right text-black">${displayValue}</span>
      </div>
    `;
}



export function generateReceiptHtml(data: CBEReceiptData): string {  
  const { company, customer, payment, amountInWords, qrCodeBase64 } = data;
  const cbeLogoBaseImage = "data:image/png;base64,"
  const cbeStampBaseImage = "data:image/png;base64,"
  return `
      <!DOCTYPE html>
      <html lang="en">
      <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>${company.receiptTitle} - ${company.name}</title>
        <script src="https://cdn.tailwindcss.com"></script>
        <style>
           body {
            -webkit-print-color-adjust: exact;
            print-color-adjust: exact;
            color: black;
          }
        </style>
      </head>
      <body>
        <div class="w-full max-w-5xl mx-auto bg-white rounded-md text-black overflow-hidden">
          <!-- Receipt Header -->
          <div class="bg-[#83257a] print:bg-[#83257a] text-white px-4 py-2 text-center flex items-center">
            <img width="60" height="50" class="rounded-lg" src="${cbeLogoBaseImage}" />
            <div class="ml-4 mr-auto w-full">
              <h1 class="text-xl font-bold">${company.name}</h1>
              <p class="text-base">${company.receiptTitle}</p>
            </div>
          </div>
  
          <div class="px-6 py-4">
            <div class="grid grid-cols-2 gap-x-10 gap-y-6 mb-4">
              <!-- Company Information -->
              <div>
                <h2 class="md:text-base text-sm font-semibold mb-1 border-b pb-1 border-gray-700">Company Address & Other Information</h2>
                <div class="grid gap-0"> <!-- Reduced gap for tighter packing -->
                  ${generateInfoItemHtml(
                    "Country:",
                    company.country,
                  )}
                  ${generateInfoItemHtml(
                    "City:",
                    company.city,
                  )}
                  ${generateInfoItemHtml(
                    "Address:",
                    company.address,
                  )}
                  ${generateInfoItemHtml("Postal code:", company.postalCode)}
                  ${generateInfoItemHtml("SWIFT Code:", company.swiftCode)}
                  ${generateInfoItemHtml("Email:", company.email)}
                  ${generateInfoItemHtml("Tel:", company.tel)}
                  ${generateInfoItemHtml("Fax:", company.fax)}
                  ${generateInfoItemHtml("Tfn:", company.tfn)}
                  ${generateInfoItemHtml(
                    "VAT Receipt No:",
                    company.vatReceiptNo
                  )}
                  ${generateInfoItemHtml(
                    "VAT Registration No:",
                    company.vatRegNo
                  )}
                  ${generateInfoItemHtml(
                    "VAT Registration Date:",
                    company.vatRegDate
                  )}
                </div>
              </div>
  
              <!-- Customer Information -->
              <div>
                <h2 class="md:text-base text-sm font-semibold mb-1 border-b pb-1 border-gray-700">Customer Information</h2>
                <div class="grid grid-cols-1 gap-0">
                  ${generateInfoItemHtml(
                    "Customer Name:",
                    customer.name,
                    "text-sm py-0 text-black"
                  )}
                  ${generateInfoItemHtml(
                    "Region:",
                    customer.region,
                    "text-sm py-0 text-black "
                  )}
                  ${generateInfoItemHtml(
                    "City:",
                    customer.city,
                    "text-sm py-0"
                  )}
                  ${generateInfoItemHtml("Sub City:", customer.subCity)}
                  ${generateInfoItemHtml(
                    "Wereda/Kebele:",
                    customer.weredaKebele
                  )}
                  ${generateInfoItemHtml(
                    "VAT Registration No:",
                    customer.vatRegNo
                  )}
                  ${generateInfoItemHtml(
                    "VAT Registration Date:",
                    customer.vatRegDate
                  )}
                  ${generateInfoItemHtml("TIN (TAX ID):", customer.tin)}
                  ${generateInfoItemHtml("Branch:", customer.branch)}
                </div>
              </div>
            </div>
  
            <!-- Payment Information -->
            <div class="mb-4 rounded-md relative border border-[#83257a]"">
              <h2 class="md:text-base text-sm font-medium py-2 px-4  text-center border-black border-b">Payment / Transaction Information</h2>
              <div class="rounded-md overflow-hidden flex flex-col gap-1">
                ${generateInfoItemHtml(
                  "Payer:",
                  payment.payer,
                  "border-b border-black text-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "Account:",
                  payment.payerAccount,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "Receiver:",
                  payment.receiver,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "Account:",
                  payment.receiverAccount,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "Payment Date & Time:",
                  payment.dateTime,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "Reference No. (VAT Invoice No):",
                  payment.referenceNo,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "Reason / Type of service:",
                  payment.reason,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "Transferred Amount:",
                  payment.amount,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "Commission or Service Charge:",
                  payment.commission,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                ${generateInfoItemHtml(
                  "15% VAT on Commission:",
                  payment.vatOnCommission,
                  "border-b border-black text-sm md:text-base py-2 px-4",
                  true
                )}
                <div class="pt-1">
                  ${generateInfoItemHtml(
                    "Total amount debited from customer's account:",
                    payment.totalDebited,
                    "text-sm md:text-base font-semibold py-2 px-4",
                    true
                  )}
                </div>
              </div>
              <img
                v-if="receiptData.company.logoBase64"
                width="200"
                height="200"
                class="absolute top-[35%] left-[35%] z-50"
                src="${cbeStampBaseImage}"
                alt="Company Logo"
              />
            </div>
  
            <!-- Amount in Words -->
            <div class="flex items-center justify-between p-0 gap-4">
              <div class="bg-gray-100 p-3 rounded-lg text-center h-fit w-full space-y-1">
                <p class="font-semibold text-black">Amount in Word:</p>
                <p class="text-black font-medium text-xs">${amountInWords}</p>
              </div>
              <UiCard
                class="w-24 h-24 flex justify-center items-center  place-self-center bg-gray-50 dark:bg-white"
              >
                <img
                  src=${qrCodeBase64}
                  alt="QR Code"
                />
              </UiCard>
            </div>
  
            <!-- Footer -->
            <div class="text-center text-gray-600 pt-2 border-t border-gray-500 text-sm">
              <p class="font-semibold text-[#83257a]">The Bank you can always rely on.</p> <!-- Using a standard blue -->
              <p class="text-xs text-black">  ${new Date().getFullYear()} ${
                company.name
              }. All rights reserved.</p>
            </div>
          </div>
        </div>
      </body>
      </html>
    `;
}
